import React from 'react';
import Title from "../components/basic/title/Title";
import Header from "../components/user/header/Header";

const Cart = () => {
    return (
        <div>
            <Header/>
            <Title props="Корзина товаров"/>
        </div>
    );
};

export default Cart;
